// Dark and Light Theme

export const lightTheme = {
  body: "#FCF6F4",
  text: "#000000",
  fontFamily: "'Source Sans Pro', sans-serif",
  bodyRgba: "252, 246, 244",
  textRgba: "0,0,0",
  backgroundImage: "url(" + "https://www.sammyfans.com/wp-content/uploads/2021/08/galaxy-z-fold-3-wallpaper-img.jpg" + ")",
};

export const DarkTheme = {
  body: "#000000",
  text: "#FCF6F4",
  color:"#FCF6F4",
  backgroundColor:"#000",
  fontFamily: "'Source Sans Pro', sans-serif",
  bodyRgba: "0, 0, 0",
  textRgba: "252,246,244",
};
